import React from "react";

const RoomTop = () => {
    return (
        <section>

            <div className="overlay">
                <img className="room-image" src={`${process.env.PUBLIC_URL}/vivian-source/room2.jpg`} alt="Room" />
                <div className="text-overlay">
                        Rooms
                </div>
            </div> 

            <div className="card-grid">
                <div className="card">
                    <img className="card-image" src={`${process.env.PUBLIC_URL}/vivian-source/room2.jpg`} alt="group-room"></img>
                    <div className="card-name">Card name 1</div>
                </div>
            </div>


        </section>
    );
};

export default RoomTop;
